import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useCart } from '../context/CartContext';

const Navbar = () => {
  const { user, logout, getCartCount } = useCart();
  const cartCount = getCartCount();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    logout();
    window.location.href = '/';
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  // Styles
  const styles = {
    navbar: { backgroundColor: '#fff', padding: '0.5rem 1rem', borderBottom: '1px solid #ddd', position: 'sticky', top: 0, zIndex: 1000 },
    container: { maxWidth: '1200px', margin: '0 auto', display: 'flex', justifyContent: 'space-between', alignItems: 'center', flexWrap: 'wrap' },
    brand: { display: 'flex', alignItems: 'center', gap: '8px', fontWeight: 'bold', fontSize: '1.2rem', textDecoration: 'none', color: '#2c3e50' },
    links: { display: 'flex', alignItems: 'center', gap: '1rem', listStyle: 'none' },
    linkItem: { textDecoration: 'none', color: '#2c3e50' },
    cartBadge: { backgroundColor: '#e74c3c', color: '#fff', borderRadius: '50%', padding: '2px 6px', marginLeft: '5px', fontSize: '0.8rem' },
    btn: { padding: '5px 15px', border: 'none', borderRadius: '5px', cursor: 'pointer' },
    btnDanger: { backgroundColor: '#e74c3c', color: '#fff' },
    hamburger: { display: 'none', flexDirection: 'column', cursor: 'pointer' },
    bar: { width: '25px', height: '3px', backgroundColor: '#2c3e50', margin: '4px 0' },
    mobileMenu: { display: isMobileMenuOpen ? 'flex' : 'none', flexDirection: 'column', width: '100%', marginTop: '0.5rem', gap: '0.5rem' },
  };

  return (
    <nav style={styles.navbar}>
      <div style={styles.container}>
        <Link to="/" style={styles.brand}>
          <img src="/logo.svg" alt="Trendify Logo" style={{ height: '32px', width: '32px' }} />
          Trendify
        </Link>

        {/* Hamburger menu for mobile */}
        <div
          style={{ ...styles.hamburger, display: 'flex' }}
          onClick={toggleMobileMenu}
        >
          <div style={styles.bar}></div>
          <div style={styles.bar}></div>
          <div style={styles.bar}></div>
        </div>

        {/* Desktop links */}
        <ul className="navbar-links" style={{ ...styles.links, display: window.innerWidth > 768 ? 'flex' : 'none' }}>
          <li><Link to="/" style={styles.linkItem}>Home</Link></li>
          <li><Link to="/products" style={styles.linkItem}>Products</Link></li>
          <li>
            <Link to="/cart" style={styles.linkItem}>
              Cart {cartCount > 0 && <span style={styles.cartBadge}>{cartCount}</span>}
            </Link>
          </li>
          {user ? (
            <>
              <li><span>Hello, {user.name}</span></li>
              <li>
                <button onClick={handleLogout} style={{ ...styles.btn, ...styles.btnDanger }}>Logout</button>
              </li>
            </>
          ) : (
            <>
              <li><Link to="/login" style={styles.linkItem}>Login</Link></li>
              <li><Link to="/register" style={styles.linkItem}>Register</Link></li>
            </>
          )}
        </ul>

        {/* Mobile menu */}
        <div style={{ ...styles.mobileMenu }}>
          <Link to="/" style={styles.linkItem} onClick={toggleMobileMenu}>Home</Link>
          <Link to="/products" style={styles.linkItem} onClick={toggleMobileMenu}>Products</Link>
          <Link to="/cart" style={styles.linkItem} onClick={toggleMobileMenu}>
            Cart {cartCount > 0 && <span style={styles.cartBadge}>{cartCount}</span>}
          </Link>
          {user ? (
            <>
              <span>Hello, {user.name}</span>
              <button onClick={() => { handleLogout(); toggleMobileMenu(); }} style={{ ...styles.btn, ...styles.btnDanger }}>Logout</button>
            </>
          ) : (
            <>
              <Link to="/login" style={styles.linkItem} onClick={toggleMobileMenu}>Login</Link>
              <Link to="/register" style={styles.linkItem} onClick={toggleMobileMenu}>Register</Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
